import './product-item.css'
const ProductItem=(obj)=>{
 
  let object=obj.obj
 console.log(object)

 if(object!==undefined){
    
    return(
<div className="productElement">
    <div></div>
    <div>
        <h4>{object.model}</h4>
        <h3>{object.price}</h3>
    </div>
</div>
    ) 
 }
 
    return(
       <>
       </>
    )
}
export default ProductItem
